selector_to_html = {"a[href=\"#how-a-scheduled-transfer-works\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">How a scheduled transfer works<a class=\"headerlink\" href=\"#how-a-scheduled-transfer-works\" title=\"Link to this heading\">#</a></h2><p>When you submit the transaction to the chain, the following happens:</p>", "a[href=\"#multisig-schedule-regular\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Option 1: Create a regular interval schedule<a class=\"headerlink\" href=\"#option-1-create-a-regular-interval-schedule\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#generate-the-transaction\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Generate the transaction<a class=\"headerlink\" href=\"#generate-the-transaction\" title=\"Link to this heading\">#</a></h2><p>There are two ways that you can generate the transaction:</p>", "a[href=\"#add-a-release-schedule\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Add a release schedule<a class=\"headerlink\" href=\"#add-a-release-schedule\" title=\"Link to this heading\">#</a></h2><p>You can now create a release schedule and specify when you want the transfer to take place. You can choose between a regular interval schedule and an explicit schedule.</p>", "a[href=\"#generate-sign-scheduled\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Generate and sign the transaction proposal on the LEDGER device<a class=\"headerlink\" href=\"#generate-and-sign-the-transaction-proposal-on-the-ledger-device\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#option-2-create-an-explicit-schedule\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Option 2: Create an explicit schedule<a class=\"headerlink\" href=\"#option-2-create-an-explicit-schedule\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#export-scheduled-proposal\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Export a transaction proposal<a class=\"headerlink\" href=\"#export-a-transaction-proposal\" title=\"Link to this heading\">#</a></h2><p>To propose a transaction to other co-signers, you have to share a file with them of the type JSON, which contains the transaction information.</p>", "a[href=\"#make-a-transfer-proposal\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Make a transfer proposal<a class=\"headerlink\" href=\"#make-a-transfer-proposal\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#generate-scheduled-without-sign\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Generate the transaction proposal without signing<a class=\"headerlink\" href=\"#generate-the-transaction-proposal-without-signing\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#generate-and-sign-the-transaction-proposal-on-the-ledger-device\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Generate and sign the transaction proposal on the LEDGER device<a class=\"headerlink\" href=\"#generate-and-sign-the-transaction-proposal-on-the-ledger-device\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#create-a-scheduled-transfer-in-the-desktop-wallet\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Create a scheduled transfer in the Desktop Wallet<a class=\"headerlink\" href=\"#create-a-scheduled-transfer-in-the-desktop-wallet\" title=\"Link to this heading\">#</a></h1><h2>Send CCD with a schedule<a class=\"headerlink\" href=\"#send-ccd-with-a-schedule\" title=\"Link to this heading\">#</a></h2><p>This guide describes how you create a multi-signature transfer with a schedule. For information about multi-signature transfer without a schedule, see <a class=\"reference internal\" href=\"../desktop-wallet/multisig-simple-transfer.html#create-multisig\"><span class=\"std std-ref\">Create a multi-signature CCD transfer in the Desktop Wallet</span></a>.</p>", "a[href=\"#export-a-transaction-proposal\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Export a transaction proposal<a class=\"headerlink\" href=\"#export-a-transaction-proposal\" title=\"Link to this heading\">#</a></h2><p>To propose a transaction to other co-signers, you have to share a file with them of the type JSON, which contains the transaction information.</p>", "a[href=\"#prerequisites\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Prerequisites<a class=\"headerlink\" href=\"#prerequisites\" title=\"Link to this heading\">#</a></h2><p>A multi-signature transfer of CCD is a transaction that\nrequires two or more co-signers to sign with their private keys to\nauthorize the transaction.</p><p>To plan a multi-signature transfer ahead of time and to split the transfer into multiple releases, you can create a release schedule. Using a schedule, you specify the total amount of CCD to transfer and then the specific dates and times for each CCD release. In other words, you create one transfer with multiple releases.</p>", "a[href=\"#receive-signatures-from-co-signers\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Receive signatures from co-signers<a class=\"headerlink\" href=\"#receive-signatures-from-co-signers\" title=\"Link to this heading\">#</a></h2><p>When the co-signers have signed the transaction, they return the signed transaction proposal to you, and you have to import the files into the Desktop Wallet before you can submit the transaction to the blockchain.</p>", "a[href=\"../desktop-wallet/multisig-simple-transfer.html#create-multisig\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Create a multi-signature CCD transfer in the Desktop Wallet<a class=\"headerlink\" href=\"#create-a-multi-signature-ccd-transfer-in-the-desktop-wallet\" title=\"Link to this heading\">#</a></h1><p>A multi-signature transfer of CCD is a transaction that\nrequires two or more co-signers to sign with their private keys to\nauthorize the transaction.</p>", "a[href=\"create-identity.html#create-initial-account\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Create an identity<a class=\"headerlink\" href=\"#create-an-identity\" title=\"Link to this heading\">#</a></h1><p>Before you can start using a Wallet and submit transactions to the blockchain, you need an identity issued by an identity provider, and, in the case of Concordium Legacy Wallet and Desktop Wallet, an initial account issued by the identity provider. The identity provider submits the initial account to the chain and knows the identity of the owner of the initial account, but not of any other accounts that you create. For Concordium Wallet for Web and Concordium Wallet for Mobile, an initial account is not submitted by the identity provider.</p><p>To learn more about identities and accounts, see <a class=\"reference internal\" href=\"../concepts/id-accounts.html#reference-id-accounts\"><span class=\"std std-ref\">Identities</span></a> and <a class=\"reference internal\" href=\"../references/manage-accounts.html#managing-accounts\"><span class=\"std std-ref\">Accounts</span></a>.</p>", "a[href=\"#multisig-schedule-generate\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Generate the transaction<a class=\"headerlink\" href=\"#generate-the-transaction\" title=\"Link to this heading\">#</a></h2><p>There are two ways that you can generate the transaction:</p>", "a[href=\"#multisig-schedule-explicit\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Option 2: Create an explicit schedule<a class=\"headerlink\" href=\"#option-2-create-an-explicit-schedule\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#generate-the-transaction-proposal-without-signing\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Generate the transaction proposal without signing<a class=\"headerlink\" href=\"#generate-the-transaction-proposal-without-signing\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#option-1-create-a-regular-interval-schedule\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Option 1: Create a regular interval schedule<a class=\"headerlink\" href=\"#option-1-create-a-regular-interval-schedule\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#send-ccd-with-a-schedule\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Send CCD with a schedule<a class=\"headerlink\" href=\"#send-ccd-with-a-schedule\" title=\"Link to this heading\">#</a></h2><p>This guide describes how you create a multi-signature transfer with a schedule. For information about multi-signature transfer without a schedule, see <a class=\"reference internal\" href=\"../desktop-wallet/multisig-simple-transfer.html#create-multisig\"><span class=\"std std-ref\">Create a multi-signature CCD transfer in the Desktop Wallet</span></a>.</p>", "a[href=\"../desktop-wallet/accounts-desktop.html#overview-account-desktop\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Desktop Wallet navigation and settings<a class=\"headerlink\" href=\"#desktop-wallet-navigation-and-settings\" title=\"Link to this heading\">#</a></h1><p>This topic describes the information and the tasks that are available in the Desktop Wallet. To learn more about creating accounts, see <a class=\"reference internal\" href=\"../guides/create-account.html#create-account\"><span class=\"std std-ref\">Create an account in the Desktop Wallet</span></a>.</p><p>To view information about an account, go to <strong>Accounts</strong> and select the relevant account. At the top of the window you see the following:</p>", "a[href=\"#release-schedule-types\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Release schedule types<a class=\"headerlink\" href=\"#release-schedule-types\" title=\"Link to this heading\">#</a></h2><p>You can create two types of release schedules: a regular interval\nschedule and an explicit schedule.</p>", "a[href=\"multi-credentials.html#multi-credentials\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Add credentials to an account<a class=\"headerlink\" href=\"#add-credentials-to-an-account\" title=\"Link to this heading\">#</a></h1><h2>Add more credentials on an account<a class=\"headerlink\" href=\"#add-more-credentials-on-an-account\" title=\"Link to this heading\">#</a></h2><p>This guide describes how you add more credentials to an account, and how you <a class=\"reference internal\" href=\"#guide-change-signature\"><span class=\"std std-ref\">change the signature threshold for transactions</span></a> on the account. For more information about the process of sharing an account, see <a class=\"reference internal\" href=\"overview-shared-accounts.html#overview-shared-accounts\"><span class=\"std std-ref\">Overview of shared accounts with multiple credentials</span></a>.</p>", "a[href=\"#submit-the-transaction-to-the-blockchain\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Submit the transaction to the blockchain<a class=\"headerlink\" href=\"#submit-the-transaction-to-the-blockchain\" title=\"Link to this heading\">#</a></h2><p>When you have received and added all the required signatures, you can submit the transaction to the blockchain.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
